import{_ as a,c as e,o as t,a8 as l}from"./chunks/framework.CfV4vhYM.js";const u=JSON.parse('{"title":"北漂生活 | 2023年度总结","description":"","frontmatter":{"title":"北漂生活 | 2023年度总结","date":"2024-1-2 12:00:00","categories":["Life"],"tags":["总结"]},"headers":[],"relativePath":"blogs/Life/conclusion/2023.md","filePath":"blogs/Life/conclusion/2023.md","lastUpdated":1722227151000}'),o={name:"blogs/Life/conclusion/2023.md"},r=l('<h1 id="北漂生活-2023年度总结" tabindex="-1">北漂生活 | 2023年度总结 <a class="header-anchor" href="#北漂生活-2023年度总结" aria-label="Permalink to &quot;北漂生活 | 2023年度总结&quot;">​</a></h1><h2 id="年度关键词" tabindex="-1">年度关键词 <a class="header-anchor" href="#年度关键词" aria-label="Permalink to &quot;年度关键词&quot;">​</a></h2><p>忙碌 转变</p><h2 id="开头的感慨" tabindex="-1">开头的感慨 <a class="header-anchor" href="#开头的感慨" aria-label="Permalink to &quot;开头的感慨&quot;">​</a></h2><p>2023，工作的第三个年头，感觉做了很多事情，又感觉什么都没做</p><h2 id="工作" tabindex="-1">工作 <a class="header-anchor" href="#工作" aria-label="Permalink to &quot;工作&quot;">​</a></h2><p>创业的第二年，非常的忙碌，但是却没挣到什么钱，有点难蹦，在原本的计划中，要一边接项目养活自己一边做自己的产品，原本还挺顺利的，只是在上半年和下半年分别接了一个不好干的项目，导致在项目上面耗费了大量的心神，上半年出差两个月连连加班，每天干到12点，现在回想起来，当时都干麻了，不知道头发掉了多少根。下半年接的那个项目更是出现了亏钱的状态。这两个项目一搞，自己整个压力爆炸，出现失眠的情况。</p><p>经历了这一年的工作洗礼，我的心态发生很大的变化，或许这是一种成长吧，虽然还谈不上成熟。我更加清晰的知道自己想要什么，接下来也会做出自己的选择与努力。</p><h2 id="技术" tabindex="-1">技术 <a class="header-anchor" href="#技术" aria-label="Permalink to &quot;技术&quot;">​</a></h2><p>正如我去年预料的那样，技术路线发生了变化，入门了UE，导致现在是什么都会一点，什么都打不到精通，在工作上没有机会完全沉淀，潜心钻研某一方向。我接受了现状，寻找能否在这个基础上去做一些我想做的事情。</p><p>临近年末准备造一波轮子，供自己使用，如果可以，自然是希望能够开源甚至变现的，不过目前没想这么多，主要目的还是满足自己的需求，如今这个vuepress-reco的博客站虽然能够满足作为博客的需求，但我希望能够有自己的工作站，这个过程就会设计造轮子了，感觉这是绕不开的事情，现在大家都喜欢造轮子，我不求有什么立新点，能够满足我的应用需求既可。</p><h2 id="博客与个人仓库" tabindex="-1">博客与个人仓库 <a class="header-anchor" href="#博客与个人仓库" aria-label="Permalink to &quot;博客与个人仓库&quot;">​</a></h2><p>今年博客的更新只有两篇成品，半成品倒是不少。。工作忙只是借口，懒散才是原因，自律能力不够。</p><h2 id="生活" tabindex="-1">生活 <a class="header-anchor" href="#生活" aria-label="Permalink to &quot;生活&quot;">​</a></h2><p>今年最大的变化是作息，由于工作的影响，导致现在一两点才睡，倒不是说忙到那个点，而是报复性熬夜吧，希望今年能够改过来</p><p>以往坚持的记录今年没有坚持下来，所以今年重拾记录，加强自律。</p><p>今年照例又搬了一次家，从年初到年末又胖了，要减肥要减肥要减肥...偶尔间又多养了一只橘猫，可养的第一只狸花开始随地大便了，真头疼..</p><p>组织了几次活动，特别是年末，和朋友们去滑雪，元旦前夕大家一起做饭玩桌游打麻将，纯粹的快乐，希望来年有更多的朋友来 参加</p><h2 id="flag" tabindex="-1">Flag <a class="header-anchor" href="#flag" aria-label="Permalink to &quot;Flag&quot;">​</a></h2><p>去年的Flag真的是Flag了，没完成多少..</p><h3 id="_2024的flag" tabindex="-1">2024的flag: <a class="header-anchor" href="#_2024的flag" aria-label="Permalink to &quot;2024的flag:&quot;">​</a></h3><ol><li>坚持记录与写作</li><li>每月一本实体书</li><li>坚持运动</li><li>自律，自律，自律</li></ol>',22),i=[r];function h(n,s,c,d,p,_){return t(),e("div",null,i)}const b=a(o,[["render",h]]);export{u as __pageData,b as default};
